import Link from 'next/link';
// import styled from 'styled-components'

// Let's say you want to add custom colors
const customTheme = {
    ...theme,
    colors: {
        ...theme.colors,
        brand: {
            900: "#1a365d",
            800: "#153e75",
            700: "#2a69ac",
        },
    },
};

const NavBar = () => (
    <nav>
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
            <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
                <Link href="/">
                    <a id="logo">
                        <img className="w-32" src="/images/SpaceX-Logo.svg" />
                    </a>
                </Link>
            </div>
            <div className="lg:flex flex-grow items-center" id="example-navbar-danger">
                <ul className="flex flex-col lg:flex-row list-none lg:ml-auto">
                    <li className="nav-item">
                        <Link href="/about">
                            <a className="py-2 flex items-center text-xs uppercase font-bold font-poppins text-white hover:opacity-75">About</a>
                        </Link>
                    </li>
                </ul>
            </div>
        </div>
    </nav>
);

export default NavBar;
